import React from 'react';
import { Box, Heading } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>

      <Box>
        <Heading 
          color="dark-1" 
          size="small" 
          margin="medium"
        >
          Find places to eat in:
        </Heading>
      </Box>

      <Box>
        <Heading color="status-warning" size="xlarge" margin="medium">{props.location}</Heading>
      </Box>

    </React.Fragment>
  )
}

export default landing;
